  Component,
  Fragment
} from 'react';

class Card extends Component {
  render() {
    return(
      null
    );
  }
}

class Cards extends Component {
  render() {
    return(
      <div className={ `part-cards ${ (this.props.type === "TOP") ? "top" : "bottom" }` }>

      </div>
    );
  }
}

class Part extends Component {
  render() {
    return(
      <div className="part">
        <Cards />
      </div>
    );
  }
}

class App extends Component {
  render() {
    return(
      <Fragment>
        <Part />

        <Part />
      </Fragment>
    );
  }
}

export default App;
